import Head from 'next/head'
import styles from '../styles/Home.module.css'
import ScriptTag from 'react-script-tag'
import dynamic from 'next/dynamic'
import Topnav from '../components/layout/topnav'
import ImageGallery from 'react-image-gallery'
import PortfolioElement from '../components/layout/portfolio-element'
import { Spring, animated } from 'react-spring/renderprops.cjs'
import PortfolioProjects from '../components/layout/portfolio-projects'
import React from 'react'

const Circles = dynamic(
  () => import('../components/visuals/circles'),
  {
    ssr: false
  }
)

const avciso_images = [
  {
    original: "api/images/avciso-1.png",
    description: `AvCISO`
  },
  {
    original: "api/images/avciso-2.png",
    description: `AvCISO`
  },
  {
    original: "api/images/avciso-3.png",
    description: `AvCISO`
  }
]

const public_ballot_images = [
  {
    original: "api/images/publicballot-1.png",
    description: `PublicBallot.org`
  },
  {
    original: "api/images/publicballot-2.png",
    description: `PublicBallot.org`
  },
  {
    original: "api/images/publicballot-3.png",
    description: `PublicBallot.org`
  }
]

const software_dev_images = [
  {
    original: "api/images/3444-2.png",
    description: `Point of Service Project`
  },
  {
    original: "api/images/3444-1.png",
    description: `Point of Service Project`
  },
  {
    original: "api/images/3444-3.png",
    description: `Point of Service Project`
  }
]

function Home() {

  var fullscreen_ref = React.createRef();

  let open_window = (project) => {
    fullscreen_ref.current.open_window(project)
    document.getElementById('portfolio-main').style.opacity = 0.25
  }

  let close_window = () => {
    fullscreen_ref.current.close_window()
  }

  return (
    <div style={{backgroundColor: 'black', }}>
      <Topnav currentPage='Portfolio'></Topnav>
      <section style={{textAlign: "center"}}>
        {/*<Circles position='fixed' HD='true' />*/}

        <div className="outer" id='portfolio-main'>
          <div className="middle">
            <div className="inner">
              <h1 className='page-text' style={{marginBottom: '50px'}}>Web Development Projects</h1>
              {/*<h6 className='page-text'>Take a look at some of my web development projects</h6>*/}
              <div className="row articles" style={{color: "white", width: '100%', padding: '30px'}}>
                <div className="col-sm-6 col-md-4 item"><a href="#" style={{zIndex:50}} onClick={() => open_window('avciso')} ><img className="img-fluid" src="api/images/avciso-1.png" /></a>
                    <h3 className="name">StandardUser AvCISO</h3>
                    <p className="description">Aenean tortor est, vulputate quis leo in, vehicula rhoncus lacus. Praesent aliquam in tellus eu gravida. Aliquam varius finibus est, interdum justo suscipit id.</p>
                </div>
                <div className="col-sm-6 col-md-4 item"><a href="#" style={{zIndex:50}} onClick={() => open_window('public_ballot')} ><img className="img-fluid" src="api/images/publicballot-1.png" /></a>
                    <h3 className="name">public ballot</h3>
                    <p className="description">Aenean tortor est, vulputate quis leo in, vehicula rhoncus lacus. Praesent aliquam in tellus eu gravida. Aliquam varius finibus est, interdum justo suscipit id.</p>
                </div>
                <div className="col-sm-6 col-md-4 item"><a href="#" style={{zIndex:50}} onClick={() => open_window('software_dev')} ><img className="img-fluid" src="api/images/3444-1.png" /></a>
                    <h3 className="name">School POS Project</h3>
                    <p className="description">Aenean tortor est, vulputate quis leo in, vehicula rhoncus lacus. Praesent aliquam in tellus eu gravida. Aliquam varius finibus est, interdum justo suscipit id.</p>
                </div>
              </div>
            </div>
          </div>
        </div>

        <PortfolioProjects ref={fullscreen_ref} />

        <div style={{display: 'none'}}>
          <PortfolioElement images={avciso_images} />
          <div style={{margin: '10px'}}></div>
          <PortfolioElement images={public_ballot_images} />
          <div style={{margin: '10px'}}></div>
          <PortfolioElement images={software_dev_images} />
        </div>
      </section>
    </div>
  )
}

export default Home;
